import "../styles/globals.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { ContextWrapper } from "../contextStore";

function MyApp({ Component, pageProps }) {
  return (
    <ContextWrapper>
      {" "}
      <Component {...pageProps} />
    </ContextWrapper>
  );
}

export default MyApp;
